import React from 'react';
import Kanban from '../assets/kanban2.jpg'

function Home() {
  return (
    <div className='w-full h-screen bg-[#00000] text-black flex items-center flex-col'>
        
        <div className='flex flex-col items-center bg-[#4942E4]'>
          <h1 className='text-5xl'>"DONT BE BUSY BE PRODUCTIVE"</h1>
          <div className='max-w-80 h-auto'> 
            <img src={Kanban}/>  
          </div>
          <h2 className='text-3xl'>HOME</h2>
        </div>
        
    </div>
  )
}

export default Home
